import React from "react";
import Todo from "../Todo/Todo";

const TodoList = ({ todos }) => (
  <ul className="todo-list">
    {todos && todos.length > 0 ? (
      todos.map((todo, index) => (
        <Todo key={`todo-${index}`} todo={todo.task} />
      ))
    ) : (
      "No todos, yay!"
    )}
  </ul>
);

export default TodoList;
